sisted of artists such as Eminem, Notorious Big, Tu-Pac, Andre 3000 and more. His musical mentors at the time gave him the oppurtinty to further progress his musical talent by teaching him the fundamentals of music theory and compostion.\n<br>&nbsp;\n<br>&nbsp;At this point he became determined to become an artist himself and began learning to produce music with the popular DAW, FL Studio (\"Fruity Loops 6\", as it was known at the time). As time progressed and the music industry\n<br>began to rapidly expand its contents of genres and artists, Joshua\n<br>developed an interest becoming a DJ. He performed several local gigs\n<br>at bars and small night clubs. He then met Matthew Charles and both formed the electronic duo, \"EleChords.\"\n<br>\n<br>Joshua is still growing as an artist and doesn\'t plan to slow down until he has reached his goals and mission as a musician.','2016-11-23 21:10:17','2016-12-29 16:51:32','joshua-moreno','https://www.facebook.com/joshuamorenomusic'),(162,208,'Sweet & Sour','Anton','Kossoy','Israel','Netanya','','','bis@iamantonk.com','','uploads/artist/profiles/20518.png','frontweb/assets/images/admin/bgd_image.jpg','https://soundcloud.com/itssweetandsour','https://facebook.com/itssweetandsour','https://twitter.com/itssweetandsour','','https://instagram.com/itssweetandsour','','2016-11-24 17:39:34','2016-11-24 17:51:15','sweet-sour','https://www.facebook.com/itssweetandsour/'),(163,209,'','','','','','','','','','','','','','','','','','2016-11-24 19:46:40','2016-11-24 19:46:40','',''),(164,210,'Tarz','Sean','Hobbs','United Kingdom','Bristol','','','','','uploads/user/profiles/48416.jpg','frontweb/assets/images/admin/bgd_image.jpg','','','','','','','2016-11-24 19:48:15','2016-11-24 19:58:53','tarz-1',''),(165,211,'Deli J','Jamie','Delecovias','United Kingdom','London','','','','','uploads/user/profiles/22573.jpg','frontweb/assets/images/admin/bgd_image.jpg','','','','','','','2016-11-27 18:44:28','2016-11-27 19:21:06','jamie-delacovias','h