ial','https://www.facebook.com/createkofficial','https://twitter.com/CreatekMusic','https://www.youtube.com/channel/UCQuE4RaQsikoudRFzLtugFw?sub_confirmation=1','','','2017-02-01 16:38:11','2017-02-01 18:49:42','createk',''),(427,530,'MiTM','Eddie','Taylor','United Kingdom','','','','','','uploads/user/profiles/97889.png','frontweb/assets/images/admin/bgd_image.jpg','https://soundcloud.com/official-mitm','https://www.facebook.com/official.mitm/','https://twitter.com/MiTM_1','','','Tracks Signed to:\r<br/>DMC\r<br/>Kinky Trax\r<br/>DiscoBall Records\r<br/>Soul Legends Records\r<br/>Good Times Recordings\r<br/>\r<br/>I started learning to Dj when I was 13 (back in the very late 80s/early 90s), with 1 turntable and a double tape deck, making simple mixes by stopping and recording the parts I needed untill I had got my first pair of technics 1210s. \r<br/>\r<br/>Style\r<br/>------\r<br/>My style started with hip-hop/rap in the NWA/Public Enemy era then moved up to the now named classic house and hardcore genres. I have dj\'ed most styles including: Bounce, Hardcore, HipHop/Rap and most variations of house. With House Always being my first love, i\'m now concentrating on Disco/Funky/Bouncy House music\r<br/>\r<br/>I\'ve dj\'ed in my own nights in Harrogate, as well as dj\'ed at: Music Factory (Leeds), Warehouse (Leeds), Love Of Life (Wales), Mocka Lounge (Cardiff) \r<br/>\r<br/>Went quiet with my djing since having a family, and started to learn to produce a few years back on and off. During this time I owned and ran a radio site which I also dj\'ed on and introduced new djs to the world of the net. Since closing it I took up producing more seriously and have been making my own boolteg/mashup tracks which can be found on this page and on my HearThis page. These tracks have had amazing feedback with offers coming back to have any original tracks I do released on labels. \r<br/>\r<br/>So watch this space for original tracks coming soon and keep upto date with any new bootlegs that are done in the mean time :)&nbsp;','2017-02-01 17:12:42','2017-02-01 18:50:21','mitm',''),(428,531,'Sergio Alejandro Chalco Narvaez','','','','','','','','','','frontweb/assets/images/admin/bgd_image.jpg','','','','','','','2017-02-01 17:21:45','2017-02-01 18:49:02','sergio-alejandro-chalco-narvaez',''),(429,532,'Moziio','Pauraic','Morrissey','Ireland','Cork','','','pauraicmorrissey@gmail.com','','uploads/artist/profiles/85753.png','frontweb/images/artist/banners/12727.png','https://soundcloud.com/moziio','','','','','Creating stories through sound.','2017-02-01 21:22:53','2017-02-02 15:06:25','moziio',''),(430,535,'Daniel Campbell','','','','','','','','','','frontweb/assets/images/admin/bgd_image.jpg','','','','','','','2017-02-02 15:39:52','2017-02-02 16:09:32','daniel-campbell',''),(431,536,'','','','','','','','','','','','','','','','','','2017-02-02 18:22:31','2017-02-02 18:22:31','',''),(432,537,'Dj Shiftwell','','','','','','','','','','frontweb/assets/images/admin/bgd_image.jpg','','','','','','','2017-02-03 14:03:09','2017-02-03 16:24:14','dj-shiftwell',''),(433,539,'YACO DJ','','','','','','','','','uploads/user/profiles/78842.jpg','frontweb/images/user/banners/50406.jpg','','','','','','DJ | PRODUCER | DESIGNER | RADIO HOST | YOUTUBER | OWNER OF @BlueBloodRec. @INVASION_EDM #LOVIX','2017-02-04 12:16:17','2017-02-04 18:50:31','yaco-dj',''),(434,542,'FAQU','Alessandro','De Cristofaro','Italy','Napoli','','','','','uploads/user/profiles/72228.png','frontweb/images/user/banners/70192.jpg','https://soundcloud.com/faqumusic','https://www.facebook.com/faquofficial/?fref=ts','https://twitter.com/faqumusic','','','','2017-02-07 16:47:09','2017-02-07 17:53:36','alessandro-de-cristofaro',''),(435,543,'Ash Lay','Ash','Lay','United Kingdom','Ipswich','','','','','uploads/user/profiles/57262.jpg','frontweb/images/user/banners/92329.jpg','https://soundcloud.com/ashlaybeats','https://www.facebook.com/ashlaybeats','https://twitter.com/ashlaybeats','https://www