INSERT INTO `faqs` VALUES (6,'Where is Sore Thumb Media based?','<p>The Sore Thumb Media office is based in Oxfordshire, England, although we are an active team with a passion for travel, aiming to meet artists and fans all over the world!</p>\r\n',1,'2016-08-06 11:04:45','2016-08-06 11:04:45'),(7,'How did the name \'Sore Thumb Media\' and slogan \'Throbbing with talent\' come about?','<p>The name originates from the idiom &#39;sticking out like a sore thumb&#39;, as our mission is to help the talented artists, that we take on to the platform, to stick out like a sore thumb. The slogan &#39;Throbbing with talent&#39; refers to the Sore Thumb Media icon, where the speaker represents the thumb throbbing (with &#39;talented&#39; music!)</p>\r\n',1,'2016-08-06 11:06:28','2016-08-06 11:06:28'),(8,'As a listener, do I need to pay anything towards the use of your site?','<p>If you&#39;re thinking that what we offer to you as a listener is too good to be true, think again. You will not be charged to use our site. That means you can take advantage of downloading or streaming a never-ending amount of music which artists have provided to you at no cost whatsoever!</p>\r\n',1,'2016-08-06 11:06:50','2016-08-06 11:06:50'),(9,'I\'m an artist. If I sign up with Sore Thumb Media, will I need to pay to use your service?','<p>Like any platform, we do offer a free subscription plan so that you can test the waters. However, we believe that the more you put into your promotion, the more you will most definitely get out of it! This is why Sore Thumb Media is aimed at artists who are willing to invest in themselves a little, so a range of subscription methods are available.</p>\r\n',1,'2016-08-06 11:07:13','2016-08-06 11:07:13'),(10,'What can Sore Thumb Media offer me that other gating platforms out there can\'t?','<p>Half of the answer is in the question. Sore Thumb Media is not just a gating platform but also a multi-promotion platform that offers unlimited gating, exclusive track releases, remix competitions, a multi-genre discovery section, bespoke music video&#39;s and more, all for an affordable monthly cost (subject to subscription package). We&#39;re also a very personable platform and believe we are a community where artists can network.</p>\r\n',1,'2016-08-06 11:07:29','2016-08-06 11:07:29');
/*!40000 ALTER TABLE `faqs` ENABLE KEYS */;
UNLOCK TABLES;

