INSERT INTO `news` VALUES (6,131,6,'Avicii: A Pioneer of the Genre','<p>Earlier this year, Swedish producer Tim Bergling, known to the world as Avicii, announced his retirement from touring. News which came as a shock to most has led to many emotional farewells from other producers and fans alike, it is abundantly clear that he will be sorely missed. It feels very reminiscent of when Swedish House Mafia threw in the towel just a few years ago, which just goes to show the impact he had in dance music.</p>\r\n\r\n<p>There are very few producers that deserve as much respect as Tim Bergling. While the DJ Mag Top 100 is laughed upon by most, the fact that he was in the top 10 for the past 5 years still shows his popularity. You just know that anything associated with the name Avicii is going to be high quality and when listening to a new song of his you can almost guarantee it will be faultless. But the thing that really sets him apart is that he is one of a small number of artists that makes the music he wants to make, and doesn&#39;t try and follow trends. In recent years so many big producers have experimented with popular trends of the time, whether it be bass house, jungle terror or now future bass, many jump on the band wagon. Don&#39;t get me wrong, I have nothing against them doing this whatsoever. An established artist is going to bring his own talents to the genre and also bring it to thousands more fans. But an artist that can truly say they have made their own music, exactly the way they wanted is a rare and special talent.</p>\r\n\r\n<p>I remember first listening to the album &#39;True&#39;. It was nothing like I had ever listened to before, my first thought was EDM meets folk or country. I have to admit, being a young lad just starting to immerse myself into dance music, I was initially disappointed. Looking back I think I expected &#39;Levels&#39; repeated 12 times on one album, but I soon realised how magnificent that album was and how Avicii had delivered so much more. Every song was uniquely crafted, almost all with beautiful vocals and it was without a doubt one of the best EDM albums released to date. Even now I would struggle to name any one else that has tried to recreate that style and done it justice. It just had such a magnificent range of songs, from largely overlooked masterpieces such as &#39;Dear Boy&#39; featuring M&Oslash;, now of &#39;Lean On&#39; fame, to the songs loved by thousands. &#39;Wake Me Up&#39;, &#39;Hey Brother&#39;, &#39;You Make Me&#39; &amp; &#39;Addicted To You&#39;, just to name a few. &nbsp;</p>\r\n\r\n<p>That was one thing Avicii always excelled at. Bringing EDM into the spotlight and into the mainstream. If you play &#39;Seek Bromance&#39; to a group of people, I guarantee you that the majority of people will recognise it. They&#39;d probably have no idea it was produced by Avicii, but seeing as it was released under his earlier alias of Tim Berg that&#39;s understandable. Since then he has gone onto release a number of songs that proved popular outside of EDM, even co-producing Coldplay&#39;s 2014 hit &#39;A Sky Full of Stars&#39;. However most would agree that &#39;Levels&#39; was probably the song that cemented his name as one of the great producers of our generation, and it still gives me goose bumps every time I hear it live. It takes me straight back to my first ever EDM show, which was Avicii at the Manchester Arena. Towards the end of the set there was thirty seconds of silence, then that iconic vocal just tore through the building, prompting flares to be lit in the standing area and sending shivers down the spine of everybody in the room. It is a memory I can guarantee I will have forever, and stands out as the moment I realised I was hooked on EDM and that I wanted nothing more to be part of this scene.</p>\r\n\r\n<p>That show was part of the True tour and during the set he premiered a number of songs from the remix album, True (Avicii by Avicii). What kind of man takes a whole album he made, and remixes every single song? Only Avicii could get away with that. It showed he understood the balance of wanting to make beautiful songs that would prove a hit in the mainstream, while still wanting to keep enough energy to put on one hell of a live show. It reminds me of another bold move he made, and that was to collaborate with hundreds of his fans. Unfortunately when he revealed the &#39;Avicii x You&#39; project I was not experienced enough in production to submit anything worthwhile, but the project itself was brilliant.&nbsp; It gave so many people the chance to be involved in a song and typified Avicii&#39;s constant efforts to please his fans. I think I speak for us all when I say he certainly did please us, and very rarely disappointed, if ever.</p>\r\n\r\n<p>Avicii&#39;s second album &#39;Stories&#39; flew under the radar somewhat. &#39;Waiting For Love&#39;, which was co-produced by Dutch maestro Martin Garrix hit the big time but the rest of the album got almost ignored. I can honestly say I have no idea why. The album is yet another masterpiece, featuring song after song of pure quality. &#39;Ten More Days&#39; is one of the most moving and relatable songs I have ever listened to, and much of the album is similarly emotional. Maybe this should have been a sign of the personal struggles Tim was going through, but still not many could have predicted a complete retirement.</p>\r\n\r\n<p>It leaves the question hanging in everybody&#39;s mind. What next? In February Avicii&#39;s third studio album was announced, rumoured to be titled &#39;Equal&#39;. I can only hope that his retirement from touring will mean more time available for the creation of that album. I&#39;m calling it now, it is going to be mind-blowing. It is going to be as flawless as the first two, and I imagine it will also reach the mainstream height that True did, but Stories didn&#39;t. We will all certainly be hoping Avicii one day feels ready to return to live shows, but until then let&#39;s just appreciate the music he has already blessed us with and the songs yet to be released.</p>\r\n','Avicii,Music,Retire','uploads/news/66213.jpg','2016-10-19 13:51:22','2016-11-30 21:36:09','avicii-a-pioneer-of-the-genre'),(7,106,6,'Music Producers Spam & Run (Not a Marathon Diet)','<p>It&rsquo;s the light at the end of the tunnel for some producers, sending songs off to a record label with that dream of getting signed and releasing your music to the big wide world. However, there are respectable ways of doing it and there are some tactics you should try to&nbsp;avoid if you want to have a chance of your music being listened to. Let me share my thoughts from what seems to be a hot topic in my Facebook news feed at the moment.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>The classic &ldquo;Spam &amp; Run&rdquo;</strong></p>\r\n\r\n<p>Ugh, nothing is more off putting for a record label, music promoter or blogger (such as me) than a plain old link sent in a private/direct message with no personality to it. If you adopt this method in your approach then the chances are, you won&rsquo;t get it listened to. If you want to stand out, at least make an effort by starting a conversation and engaging with the label/blogger before you send over that massive track you have spent hours&nbsp;working on. This is still no guarantee but it will put you ahead and who knows, you may develop a friendship with that label/blogger.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Another thing I would add is that if you want to get involved on a label, show interest in some of the uploads and releases that they&rsquo;ve pushed out. Leave a comment on SoundCloud, Facebook, Twitter, drop a like, all that good stuff and keep that up regularly, not just a one off. If you are persistent on this front then you will get noticed!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&ldquo;Hey bro, cool track, we gotta collab!!&rdquo;</strong></p>\r\n\r\n<p>Nope, we don&rsquo;t. When you get&nbsp;a comment like this on your tracks, it&rsquo;s often by someone who just wanted to get more followers. More specifically YOUR&nbsp;followers that&nbsp;you&rsquo;ve spent years getting built&nbsp;up through hard work and sheer persistence. Now, I&rsquo;m not saying dismiss EVERY message you get like this because if you trace back to the person&rsquo;s profile and they have a complimentary&nbsp;style to yours then that&rsquo;s a good starting point. Get the conversation going, add each other on Facebook, Twitter etc. From my experience, when I have responded to these types of messages, it falls silent on the other side so I have developed a strategy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>As a solo artist, I&rsquo;m used to doing my&nbsp;own thing. I work during the week&nbsp;which takes up most of the day, I get back home, get out of those yucky work clothes, have dinner and then only have a couple of hours in the evening when I&rsquo;m already tired to try and work on music. So a simple EP idea of &ldquo;I do two tracks, you do two tracks and we remix one (or both) of each other&rsquo;s tracks for an 8 track EP&rdquo; seems to be a good tactic to get a nice blend for the &ldquo;collab&rdquo;. It doesn&rsquo;t take too much out of you and you have the ability to get songs made quicker than bouncing music projects back and forth, making sure you both have the right VSTs and so on.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>The &ldquo;mass tag&rdquo;</strong></p>\r\n\r\n<p>Effectively, this is the same thing as the spam &amp; run tactic, just in the public domain. I know Facebook is very limiting to who it shows posts to and sometimes, seeing the responses being next to nothing on something you have spent hours, days, weeks, even months over is so depressing. Especially when someone posts a video of a cat or some girls in a bikini that gets a huge&nbsp;response from our &ldquo;thirsty&rdquo; cousins. My advice here (more a personal preference) would be, don&rsquo;t be lazy, send a nice message to your friends/music producers/bloggers who you want to listen to your creation and you will get a more organic response.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Call me old fashioned but it makes a difference when you add that personal touch. We all have busy lives and as music producers, we&rsquo;re itching to share our work, get it heard and spread the love but keep your integrity, be true to yourself and stay humble.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>What are your experiences with these &ldquo;phenomena&rdquo;? Do they annoy you as much as me?! Any other tips and tricks for approaching labels and bloggers?&nbsp;Let me know in the comments below&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Take it easy,</p>\r\n\r\n<p>Nicky</p>\r\n','Promotion,Spam,Music','uploads/news/61914.jpg','2016-10-20 08:50:45','2016-11-30 21:35:55','music-producer-s-spam-run-not-a-marathon-diet'),(8,133,6,'Luminosity Festival 2016','<p>&quot;Luminosity - the pinnacle of Trance music.&nbsp; This is where the top talent from around the world comes to blow away your senses.&nbsp; If you&#39;re looking for an electric atmosphere, a banging sound system, and a lineup of charismatic DJ&#39;s, then this is your church.&nbsp; If you love Trance music, you should come here.&nbsp; If you don&#39;t know if you like Trance music, then you MUST come here.&quot;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Picture the scene - a quiet, serene beach on the coast of Holland.&nbsp; In the distance, deep blue waves lap against the shore.&nbsp; The sun is high in the sky, basking you in golden warmth.&nbsp; You walk towards the sand, a feeling of serenity washing over you.&nbsp; Then you hear it.&nbsp; Quietly at first, then louder....&nbsp; Boom, boom, boom....&nbsp; It sounds like the banging drum on a Viking longboat.&nbsp; You see a trickle of people heading towards it, as if being called by some archaic deity.&nbsp; As you get nearer, the volume increases.&nbsp; It begins to take on a tribal quality, and you picture scenes from Avatar.&nbsp; You begin to feel a tinge of anxious excitement, a little worm of anticipation in your belly.&nbsp; You press on to the source of the sound.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>As you approach the ever growing rumble, you see a construct of glass and steel encroaching on the sand, with a small crowd of people queuing outside.&nbsp; A simple hut marks the entrance, and if you&#39;ve bought your ticket, a ten minute wait will see you through.&nbsp; Friendly and polite staff take your tickets and give your wristband - orange for the weekend, or green for day passes.&nbsp; If you need a ticket, go to the little hut - but get there early, as this place gets sold out quickly.&nbsp; And when you walk in, you quickly see why.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The venue is split into three outdoor areas, a main stage flanked by two smaller arenas.&nbsp; Each stage is contained in what can only be described as large greenhouses - more about these later - with the speakers set up at the front and the DJ visible, almost close enough to reach.&nbsp; The whole setup is spread partly across wooden flooring and partly across the beach, meaning you can get your feet sandy anytime you feel like it, or flop down on one of the benches set up outside the dancing areas.&nbsp; The three arenas are connected by a bar, where ravers can attain much needed sustenance.&nbsp; None of the areas is spared from the music - if you need a break from the banging bass and kick drums, you&rsquo;ll need to venture down the beach for at least 10 minutes before the thunderous vibration reduces to a non-invasive level.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Drinks in hand, we were ready to hit the dance floors.&nbsp; The first stop was the Fuel arena, adjacent to the bar.&nbsp; The DJ booth was set up in close proximity to a small dance area, allowing a more immersed experience with the DJ&#39;s.&nbsp; The two on stage - Re:Locate vs Robert Nickson - were halfway through their set.&nbsp; The glass covered arena was filled with deep, banging bass lines filling the space and grabbing the senses.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The first set we heard was fairly mellow, as far as Trance goes, with a steady beat and vocal sounds coming out of the gigantic speakers.&nbsp; As I absorbed the beats, I looked around me at the crowd of ravers.&nbsp; A fairly mixed bunch, around 60/40 in favour of men, with most patrons looking to be in their mid-20&rsquo;s to 40&rsquo;s.&nbsp; Some delightfully underdressed young ladies, and a few Golden Oldies, completed the scene.&nbsp; A motley crew, you might think. Except, they were all united in one important way - they were all smiling.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>That is the one theme that struck me as soon as we stepped foot into the festival, and it remained for every moment we were there - the attitude and demeanour of every person there was, to sum up in a word, happy.&nbsp; Every eye contact was met with a smile.&nbsp; If you bumped into someone, rather than the hostile glare you might expect in other environments, you would be met with a toothy grin and a nod.&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>After listening to a decent set from Will Atkinson, we began to notice a gradual increase in the number of bodies around us.&nbsp; A steady trickle of excited newcomers into the main room gave the atmosphere a jolt, making us feel a heightened sense of anticipation - whatever was going to happen, a lot of people wanted to see it.&nbsp; I pulled out my itinerary and looked at the names, for what must have been the tenth time that day.&nbsp;It&rsquo;s difficult to describe individual sets in text form, without the intense sounds and sights which made them so vivid in my mind, so I&rsquo;ll stick to the highlights.&nbsp; Markus Schulz played a strong two hour set, with his usual style of mixing dreamy, vocal trance with harder stuff.&nbsp; He&rsquo;s a great DJ to listen to for anyone who likes this type of music, for while he won&rsquo;t please hardcore fans (like myself), he will play such a variety that everyone will hear something they like.&nbsp; It has to be said, his mixing ability is stunning - building up through the various styles and mixing the moods to keep things interesting.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Next up was Jorn Van Deynhoven, who picked up the energy with a harder set.&nbsp; This got the dancers going, and as the tracks pumped out there was a noticeable increase in the activity around us.&nbsp; More and more people were trickling in from other areas of the venue and no doubt from the beach outside.&nbsp; With the sun blazing down on the glass structure surrounding us, we began to feel like exotic plants in a greenhouse. At this point the sweat drenched shirts were coming off and various be-muscled torsos were being put on display, including my own glistening carcass.&nbsp; We realised that the next act, Jordan Suckley, was attracting quite a following.&nbsp; No surprises there - he is a very talented producer and DJ.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Then the man himself came on.&nbsp; A slim chap with a boyish, mischievous looking face, he fairly bounced onto the stage to receive the cheers that greeted him.&nbsp; He kicked off with his usual heavy style, opening the set with a deep rumbling bass line as if to say &lsquo;here I am&rsquo;, before proceeding to deliver a romping set. His mastery on the decks was clear, with tracks being overlapped seamlessly and then back again, creating peaks and troughs of energy.&nbsp; He would occasionally break up the flow by dropping a savage Psy-trance track, causing the entire dance floor to erupt.&nbsp; His best moment was when he played &lsquo;Banshee&rsquo;, a personal favourite of mine and one of the best tracks I have heard live.&nbsp; The whole time he was jumping and gesticulating like a possessed monkey, infecting us all with his good mood.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The second day held a great lineup of DJ&#39;s including: Signum, Liquid Soul, John Askew and&nbsp;John O&#39;Callaghan.&nbsp; Arriving at around&nbsp;14:30, we kicked off with Standerwick who played a great upbeat set. We met up with friends we had made the day before (my erratic dance moves seem to attract a following of sorts), and soon we had a little group.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Finally, the man of the day - Bryan Kearney.&nbsp; BK is an Irish producer and DJ who also owns the Kearnage label.&nbsp; His style is generally pretty hardcore - his tracks tend to feature on the heavier end of my mixes.&nbsp; This was one set I was looking forward to the whole weekend, and I wasn&#39;t disappointed.&nbsp; He played a mixture of Trance styles - a blend of hard, vocal and dancey tunes.&nbsp; The dance floor was packed, buzzing with energy.&nbsp; At the end of his slot, it was announced that he would play another 30 minutes of Trance classics - and we all went wild.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Leaving at the end of the show meant walking out with the crowds, which we hadn&#39;t had to contend with before.&nbsp; However, due to the relatively small size of the venue, we had no trouble getting out and hailing a cab.&nbsp; Twenty minutes later we were in our hotel, enjoying hot showers and bedding down for the final day ahead of us.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>On the last day we made a special effort to get up early (10am!), as we wanted to arrive exactly at midday to catch the whole show.&nbsp; The reason behind this was simple - the main stage was due to play Trance classics all day, mixed by some of the best DJ&#39;s out there including Paul van Dyk.&nbsp; These tunes are timeless and were being enjoyed by ravers in the 90&#39;s whilst I was still in nappies.&nbsp; This was going to be a good day.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Jam El Mar (from Jam &amp; Spoon) was on first, and played a reasonably mellow set as could be expected for the first one on.&nbsp; Then followed Union Jack, a bouncy duo who played a reasonably minimal techy set.&nbsp; This warmed us up nicely for the Anjunabeats classics by Super8 &amp; Tab. &nbsp;This label tends to be quite commercial sounding, especially to a hardcore Trance fan like me, so I was pleasantly surprised when their set got me and my friends jumping up and down.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Next up was Binary Finary - for those who don&#39;t know, these guys have put out some seriously good classics including some of my personal favourites.&nbsp; They didn&#39;t disappoint, with a great dancey set that got everyone moving.&nbsp; By the time Kai Tracid came on, it was time for one of our little strolls on the beach - sorry Kai!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We came back just in time for one of my all time favourite DJ&rsquo;s, Judge Jules.&nbsp; I remember listening to one of his mix CD&#39;s when I was younger, during some furiously energetic dog walks.&nbsp; He lived up to his reputation, with a hard set full of skilled drops, blends and samples.&nbsp; Each time I thought he couldn&#39;t ramp the mood up any further, he would drop a track that got the floor moving again.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Eddie Halliwell followed, to the acclaim of a number of my new acquaintances.&nbsp; I found his style slightly distracting - lots of tricks and ploys with the decks, but I prefer a clean set where the tracks are allowed to play as they were intended.&nbsp; The occasional subtle surprise is what I like form my DJ - I found Eddie to be a tad too involved for my taste, but he certainly won the hearts of those around me.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Then comes the main man, Mr Paul van Dyk.&nbsp; I&rsquo;ve heard him play at the Amnesia club in Ibiza, and I was expecting a fairly pedestrian performance to go along with his broad appeal.&nbsp; I couldn&rsquo;t have been more wrong.&nbsp; From the moment he came on he had us all mesmerised, a captive audience enthralled by his musical dexterity.&nbsp; Wearing dark glasses, a black shirt and black cap, he looked like an agent sent from some sinister organisation to hypnotise the masses.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>From this sombre figure exploded a medley of sound from which there was no escape.&nbsp; After twenty minutes I knew he was in the process of blowing me away, along with the rest of my compatriots.&nbsp; I couldn&rsquo;t recognise most of the tracks he was playing, but I didn&rsquo;t care - the ebb and flow of the styles had my body moving and my mind wondering.&nbsp; By this point my feet were a collection of aching bones, but I paid no heed.&nbsp; When I thought I had nothing left to give, he somehow got me bouncing again.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The last hour was spent in between Vini Vici, a Psy-trance group, and Indecent Noise - who were playing hard trance classics.&nbsp; At this point of the night, the tempo was at full blast, and despite my ailments we rocked out for all we were worth, until the night finally closed and we were ejected from the scene, walking up the moonlit beach back to civilization.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>For any of you who want to experience this event yourself, and I cannot recommend it enough, then visit the luminosity website at <a href=\"http://luminosity-events.nl\">http://luminosity-events.nl</a> to book your tickets for next year.&nbsp; Get in there early!&nbsp; The event is very popular, as I discovered three months ago when I bought my tickets through an intermediary, at higher cost.&nbsp; Next years&rsquo; are paid up and sitting safely in my inbox, waiting for the day they will be exchange for another orange wristband.&nbsp;Thank you for taking the time to read my, rather lengthy, account of my fantastic experience at this festival.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>I hope to see you there next year!</p>\r\n\r\n<p>Jan Anderson</p>\r\n','Festival,Holland,Music,Trance,Luminosity','uploads/news/92187.jpeg','2016-10-20 09:14:11','2016-11-30 21:34:34','luminocity-festival-2016'),(9,106,6,'Soundcloud - Nicky\'s \"Two Cents\"','<p>From the midst of this year we saw dark times indeed for SoundCloud. It seems to have&nbsp;a lot of negativity surrounding&nbsp;it, apparently pandering to the &ldquo;big labels&rdquo;, &ldquo;destroying the smaller artists&rdquo;, having a &ldquo;business plan that is doomed to fail&rdquo; (as a result of the new Subscription Service which is only currently available in USA at the time of writing the article). But are all of these negative comments (from my observations on Facebook forums and online articles) about SoundCloud warranted? I&rsquo;ll give you my thoughts and experience about it here and why I don&rsquo;t think some people should be so hostile.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>First impressions</strong></p>\r\n\r\n<p>Back in 2011 when I first joined SoundCloud, I didn&rsquo;t really know what to expect from it. As far as I was concerned, it was a website where you could have a free profile and share your creations, which was ideal at the time. The limit of 2 hours upload time didn&rsquo;t really bother me initially as I didn&rsquo;t have that much content to share. I just thought it was really cool to be able to have that ability and&nbsp;get some sort of feedback from anyone who was interested in&nbsp;listening to my songs, leaving comments etc.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>As it turned out, a record label based in California (run by a top notch lad called&nbsp;<a href=\"https://www.facebook.com/tigerpawmusic/?fref=ts\">TigerPaw</a>)&nbsp;started commenting on my tracks and got in touch, all through SoundCloud! In fact, I wouldn&rsquo;t have been signed to&nbsp;<a href=\"https://www.facebook.com/AllowanceRecords/?fref=ts\">Allowance Records</a>&nbsp;if it wasn&rsquo;t for the connection through SoundCloud! Anyway, within the first 6-12 months of being on this platform, my first impressions were VERY positive! I developed friendships which have lasted to the present day and I&rsquo;ve had the chance to see some artists&nbsp;really go places on the music scene. Hugh Hardie for example, who is now a part of&nbsp;Hospital Records, was an artist I followed from the early days and I wouldn&rsquo;t have found him if it wasn&rsquo;t for SoundCloud.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>When I was developing more content, I soon realised I would need to pay for the unlimited upload time which was a bit of a bummer but when it&rsquo;s around &pound;5 a month, it&rsquo;s not exactly a lot! An area to develop a fan base, contact other artists, develop friendships, get feedback on your songs&hellip; come on, it&rsquo;s a no brainer if you want to invest in your musical development!</p>\r\n','Soundcloud,Changes,Music','uploads/news/78342.png','2016-10-20 10:31:27','2016-11-30 22:59:03','soundcloud-nicky-s-two-cents'),(12,106,6,'An Introduction to \'Chew Dog\' ','<p>Hello everyone and welcome to the first of many Sore Thumb Media press releases, where we&#39;ll be catching up with artists and picking their brains about their latest release on the platform. In this edition, we find out more about the head honcho of Sore Thumb Media, digging deeper into the creative mind of the man known as Chew Lay... or is that Chew Dog? Intrigued? Let&#39;s get straight to it!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<hr />\r\n<p><em><strong>Hi Chew, so I guess the first question for those who have been following you for a while and have known you as Chew Lay is, &quot;How did Chew Dog come about?&quot;</strong></em></p>\r\n\r\n<p>Hey Nicky, fair question there! Well, I initially produced jump up under the alias &#39;Chew Lay&#39; for 7 years spanning 2005-2012. Although I had a string of releases, I struggled to get signed to any major DnB labels mainly due to not quite hitting the mark on an engineering level &amp; wasn&rsquo;t feeling jump up at that time as much as I&rsquo;d like. So, I decided to take a break from the jump up scene to move to some different genres.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em><strong>Ah nice, a break is always good! What genres did you decide to go in to?</strong></em></p>\r\n\r\n<p>I went in to liquid DnB and various house genres for a few years after 2012, improving my musical skills on the production side of things and generally raising the standards of my own sound engineering.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em><strong>Sounds like it was a great plan! So what would you say are your current influences in the DnB scene?</strong></em></p>\r\n\r\n<p>Earlier this year (2016), I was inspired to go back to my jungle roots from some current and up and coming producers such as Mefjus, Break, Voltage, T&gt;I &amp; Ceph to name a few!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em><strong>And what were your earlier influences when you first got in to the scene?</strong></em></p>\r\n\r\n<p>I&#39;d say that some of my earlier inspirations came about from around the early 2000s era where I was heavily into DJing vinyl and playing out around Oxford with a few residencies. Some influential names from this time, to name a few, were Bad Company, Ram Trilogy, Generation Dub &amp; Dillinja!</p>\r\n\r\n<p>Going back even further to around 1995-1997, I got into Old Skool &amp; Jungle and was fortunate enough to go raving for the first time at 14 with my sister! Nicky Blackmarket and MC MC were playing at the Manor (Destiny) in Bournemouth. After cutting some shapes by the stack, I knew I had to be a part of the scene!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em><strong>Haha, awesome mate and some big heavyweight names to see at 14, no wonder you wanted to be a part of it all! So does the artist &quot;Chew Dog&quot; try to merge all of these influences or will it be something completely different?</strong></em></p>\r\n\r\n<p>A bit of both really! Chew Dog aims to create an original signature that has a hint of modern but with a more traditional style of DnB from my early days in music ranging right through the spectrum of DnB sub genres!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em><strong>And &quot;Chew Lay&quot;?</strong></em></p>\r\n\r\n<p>Chew Lay will still stand but will now be for all other genres I make generally with a more melodic vibe.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em><strong>Quality! Alright, let&#39;s talk about hardware (you can sense the more nerdy folk licking their lips with this one)! What was/is your current set-up?</strong></em></p>\r\n\r\n<p>For years I mainly used digital software, I always wished for an access virus synth as it was a favourite of many big DnB producers back in the early noughties. Although I am mainly digital still, I invested in a new studio set-up which included a Virus TI Polar and UAD satellite box to get more of a Hardware finish to my production.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em><strong>That analogue sound... you just can&#39;t beat it! I take it you used these goodies to make your latest releases? Can you tell us a bit more about &quot;Choke Chain&quot;?</strong></em></p>\r\n\r\n<p>Yeah, this is the first ever track under Chew Dog and I called it &quot;Choke Chain&quot; because of the relevance to the new alias. You would literally need a choke chain to stop me getting the results as I get a second wind into the DnB scene!</p>\r\n\r\n<p>I created the track using my virus and a nice grizzly bassline using UAD culture vulture valve to give it some real warmth and bite. The track itself was heavily influenced by spending half an hour listening to T&gt;I on SoundCloud!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em><strong>Niiiice!! And how about &quot;Hot Knives&quot;?</strong></em></p>\r\n\r\n<p>This wasn&#39;t really influenced by anything, I just went with the flow but I wanted to continue the rolling bassline style, with the theme based around smoking hash back in the day using hot knives! <strong>&nbsp;</strong></p>\r\n\r\n<p>Again, I created this one with my virus and UAD.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em><strong>Wicked mate, we&#39;re in for a treat! Just a final question for you before we let you get back to the studio! The future... get that crystal ball out! What are you looking to do?</strong></em></p>\r\n\r\n<p>I have a list of big DnB labels I would like to be signed to but with that being said, all of my tracks will be available for free download to help gain more fans and extra exposure which will feature on Sore Thumb Media&hellip; unless I get one of my desired signings that is!</p>\r\n\r\n<p>Ultimately, I&#39;d like to take things to the top and DJ around the world!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em><strong>Good goal to have mate! Thanks for spending time with us for the release and all the best for your next projects!</strong></em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em><strong>Chew Dog currently has Dj support from:</strong></em></p>\r\n\r\n<p>SUPPORTED BY:<br />\r\nNicky Blackmarket<br />\r\nGrooverider<br />\r\nMicky Finn<br />\r\nT&gt;I<br />\r\nDJ Limited<br />\r\nMaztek<br />\r\nRawtee<br />\r\nSappo<br />\r\nMuffler<br />\r\nKlone<br />\r\nSix Blade<br />\r\nMacky Gee<br />\r\nLogan Dee<br />\r\nHizzle Guy<br />\r\nMollie Collins<br />\r\nMeaker<br />\r\nMistanoize<br />\r\nBarrington<br />\r\nMiss Represents<br />\r\nBarbarix<br />\r\nMelinki<br />\r\nCoda</p>\r\n\r\n<p>&nbsp;</p>\r\n','Music,Drum n Bass','uploads/news/11348.jpg','2016-10-27 11:40:09','2016-12-01 09:34:59','chew-dog-s-article-test'),(13,106,7,'How to network on Facebook and Soundcloud & build your fanbase for free','<p>In a world where social media is dominant, getting your profile and fan base built up on social networking sites such as Facebook, Twitter, SoundCloud etc. can be tricky. We see an increasing number of sponsored ads in our newsfeed but is it possible to get your name out there for free? In this pdf, we go through some fundamental social networking tips so you can get organic growth and feedback on your music pages.</p>\r\n\r\n<p>First Impressions count:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>1 - Your artist name &amp; logo</strong></p>\r\n\r\n<p>All artists/music producers need to think about their name and logo when they first get started in the online world. These are fundamental aspects of your profile to help people recognise you when your tracks get shared across the internet.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Start by writing down a list of up to 3 unique aliases that you like the sound of and make sure you do your research to see if those names are already taken (of course, you can use your own name if you can&#39;t think of any). The last thing you want is the same name as another artist, especially if they are more progressed than you! Trade marking your alias is the ideal plan of action here but it is by no means free.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Once you&#39;ve decided on your alias, get yourself a really decent, professional looking logo that reflects your music producer profile.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2 - Your bio</strong></p>\r\n\r\n<p>So you have got your logo and an unforgettable alias sorted, the next step is to get your bio in shape. It is up to you how much information you want to disclose in this section. You can write your whole life story if you feel like or you can keep it short, sharp and to the point. This is where your fans will be looking to find out more about you as an artist so obviously keep it relevant to what you will be posting on your page.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Don&#39;t forget to add a link to your &#39;Like page&#39; in the &quot;About&quot; section (underneath the profile picture) of your main profile as you want to make it as easy as possible for people to find your music. Your &#39;Like page&#39; can then have all the relevant links to your music such as your SoundCloud &amp; YouTube etc.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Always check for spelling mistakes and make sure that whatever you have put in your bio reads well. Although it&#39;s not a CV, you still want to give a good first impression and look professional to anyone visiting your page.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>3 - Your content/status updates</strong></p>\r\n\r\n<p>Great work on the profile, it&#39;s looking swish but you haven&#39;t actually posted any content yet. Like the bio, any status updates you post should be relevant to your music.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>That&#39;s not to say just post a link to your tracks every now and again saying &quot;new track check it out&quot;. Spamming your SoundCloud links all the time is not the way to go as Facebook has special algorithms that minimise the exposure of links like Soundcloud!! You need to start branding yourself and this is where networking and building relationships comes in to play. There will be a more in-depth article about branding coming soon.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Your posts should be engaging on your personal profile. People don&#39;t just follow you because you only make good music. Personality plays a huge role too! Ensure any posts you make are positive, whether they are statuses about family and friends or business, music and even travel! Show the world that you are a normal person and people will come to love you &amp; your music!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>4 - Networking in relevant groups</strong></p>\r\n\r\n<p>The first step here is to find a Facebook group that is actually relevant to your music and sub-genre you produce. Don&#39;t go looking for a dubstep group if you make drum &amp; bass!&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Once you have found a group try and get yourself added in to it. Usually, this isn&#39;t too hard as there are so many groups out there.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>When you&#39;re added in, send a group member a friendly message, introducing yourself and that you would like some feedback on a track (you can use the template below to help with breaking the ice). Don&#39;t worry if you are not friends with this person yet, the message will still go through to their inbox because the group connects you like mutual friends and once you strike a conversation, you will more than likely add each other anyway. Always show interest in what they are doing, it is not all about you remember. Find out a bit about them and start building bridges that could potentially flourish into a solid relationship. Who knows where that could take you on your journey in the music scene?!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Template</p>\r\n\r\n<p><em>&quot;Hello [name - make it personal], how&#39;s it going/I hope you are well? I came across your profile in &ldquo;XYZ group&rdquo;, I&rsquo;m doing some networking so thought I&#39;d drop you a message as we had a mutual love for &rdquo;XYZ music&rdquo;</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If they are a producer, click to their profile and listen to one of their songs, perhaps give some comments on it in the message.</p>\r\n\r\n<p>You can wait for a response if you feel inclined or go straight for the following.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>&ldquo;I have a free download if you would like to check it? I am new to making music and am always looking to improve so I would be grateful for any feedback?&quot;</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Don&#39;t put the link in yet as it&#39;s still a bit &quot;spammy&quot;. Rather, wait for a response, which is usually affirmation that they want to hear your track (you&#39;ve built it up now). So then you say:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>&quot;Great, thanks for getting back to me. The link to the track is here, it&#39;s a bit of a [whatever the style of track is] type of track [add link to track]</em><em> </em><em>What&#39;s your Soundcloud link so I can check your music out?&quot;</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>People hate being spammed but if you have some value to offer (such as a free download) then this comes across less intrusive. After all, everyone loves a free download don&rsquo;t they? :) Giving your tracks away like this can really help make your SoundCloud more busy, which in turn shows record labels that your music is popular &amp; you have another network to promote your releases with.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Aim to message between 1-3 people per day to build a relationship with, it is amazing how much money you can save this way. Facebook advertising can be a minefield, especially if you don&rsquo;t know how to setup campaigns! By sending messages like this to 3 people per day every day for a year, you will contact at least 1,000 people, which will put you in great stead for organic growth!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>5 - SoundCloud networking</strong></p>\r\n\r\n<p>Similar to the Facebook approach, you can message like-minded producers on SoundCloud using the template mentioned previously or from any relationships built on Facebook. The idea is to create a &quot;collective group&quot; of up to 10 producers, who have a similar style of music &amp; fanbase size to you, with the aim of cross-promoting one another via SoundCloud&#39;s re-post feature. For example, when one of the producers in your group uploads a new track, the other members re-post it to their channel. It&#39;s important you make this clear in your opening message.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>This is a great way for you to grow organically with other artists as you can reach new fans and expand your network further. The re-post feature is a very useful tool to get more engagement on your channel, as long as you are willing to reciprocate this with fellow producers.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The foundations of success in any industry are built by forming great relationships and contacts. We strongly advise to make as much effort as possible to really help get your music off the ground!</p>\r\n','Music Help','uploads/news/93820.jpg','2016-12-20 17:23:19','2016-12-20 17:43:13','how-to-network-on-facebook-and-soundcloud-build-your-fanbase-for-free');
