CREATE TABLE `users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `first_name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `last_name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `email` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `user_type` enum('admin','admin_user','stm_user','artist') COLLATE utf8_unicode_ci NOT NULL,
  `status` enum('1','0') COLLATE utf8_unicode_ci NOT NULL DEFAULT '0',
  `password` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `avatar` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `remember_token` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `activation_code` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `provider_user_id` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `provider` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `stripe_customer_key` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `isTransaction` enum('0','1') COLLATE utf8_unicode_ci NOT NULL DEFAULT '0',
  `isStmArtist` enum('0','1') COLLATE utf8_unicode_ci NOT NULL DEFAULT '0',
  `slug` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `last_login_at` datetime DEFAULT NULL,
  `new_email` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `email_act_link` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `isArtist` enum('0','1') COLLATE utf8_unicode_ci NOT NULL DEFAULT '0',
  `isUser` enum('0','1') COLLATE utf8_unicode_ci NOT NULL DEFAULT '0',
  `secret_token` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `notifications` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `last_checked_date` datetime DEFAULT NULL,
  `email_notification` enum('0','1') COLLATE utf8_unicode_ci NOT NULL DEFAULT '1',
  `web_notification` enum('0','1') COLLATE utf8_unicode_ci NOT NULL DEFAULT '1',
  `stripe_id` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `card_brand` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `card_last_four` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `trial_ends_at` timestamp NULL DEFAULT NULL,
  `welcome_popup` enum('0','1') COLLATE utf8_unicode_ci NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  UNIQUE KEY `users_email_unique` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=572 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
